"""**Super()**



---




Super() is a buid-in function in python that allows a dirived (child) class. it is commonly used to avoid code duplication and facilities method resolution in multiple inheritance.




super().method_name(argumets)



**Key features of super()**





**`1.Access Parent Class Method:`**



* its allows calling methods of a parent class from within a child class.






**`2. Avoid Direct Parent Class Name:`**

* Instead of hardcoding the parent class name,super ()provides a more flexible way to reference the parent.

**`3. Common Usage :`**


* Calling the constructor (__init__)of the parent class.

* calling overridden methods.
"""

class Parent:
  def __init__(self,name):
    self.name=name
    print("parent constructor called")

class child(Parent):
    def __init__(self,name,age):
      super().__init__(name)
      self.age= age
      print("Child constructor called")


