"""**5. Key Point to Explain**



---




An abstract class can't be instantiated directly
v= Vehicle() # This will raise an error

All child classes must implement the abstract methods of the parent abstract class.

Abstract classes can have both abstract methods and `concrete (regular) methods.`
"""

from abc import ABC,abstractmethod

class Shape(ABC):
  @abstractmethod
  def caculate_area(self):
    pass


class Circle(Shape):
    def __init__(self,radius):
       self.radius= radius

    def caculate_area(self):
      return 3.14 *self.radius*self.radius
class Rectangle(Shape):
    def __init__(self,width,height):
      self.width =width
      self.height=height

    def caculate_area(self):
      return self.width* self.height


cir=Circle(5,)
red=Rectangle(10,5)
