"""**2.Create an abstract class Employee with an abstract method calculate_salary(). Implement two subclasses, FullTimeEmployee and PartTimeEmployee, which calculate salaries based on a fixed monthly salary and an hourly rate, respectively. Instantiate both classes and print their salaries.**"""

from abc import ABC,abstractmethod


class Employee(ABC):
  @abstractmethod
  def caculate_salary(self):
    pass


class FullTimeEmployee(Employee):
  def __init__(self,salary):
    self.salary=salary
  def caculate_salary(self):
    return self.salary

class PartTimeEmployee(Employee):
  def __init__(self,salary,hourly_rate):
    self.hourly_rate=hourly_rate
    self.salary=salary
  def caculate_salary(self):
    return self.salary* self.hourly_rate

Employee1=FullTimeEmployee(250000)
Employee2=PartTimeEmployee(1500,5)


print(f"FullTimeEmployee salary {Employee1.caculate_salary()}")
print(f"PartTimeEmployee's salary{Employee2.caculate_salary()}")

